import React from 'react';
import img1 from './images/t1.jpg';
//function component
function Home(){
    return (
    <div>
        <h1 className="h1color">Welcome to TouristClub!!!</h1>
        <p>Best place for travel enthusiasts.</p>
        <br />
        <hr />
        <img></img>
    </div>
    );
}

export default Home;
